import React from "react"
import listElem from './listElem'

class List extends React.Component {

    render(){
        if (this.props.users.length > 0) {
            return(
                <div className="list">
                    <h1>Твой список задач:</h1>
                    {this.props.users.map((elements) => (
                        <User onDelete={this.props.onDelete} key={elements.id} user={elements}/>
                    ))}
                </div>
            )
        }
        else {
            return (
                <div className="user">
                    <h3>No tasks</h3>
                </div>
            )
        }
    }
}

export default List
